('2342','18','7874','Villa Rühle',Null,'Villa im Beach House Stil in Porto Andratx zu verkaufen','33008','Porto Andratx ist eines der beliebtesten Wohnlagen im Südwesten Mallorcas. Diese Villa steht auf einem ca. 1.300m² großen Hang Grundstück mit fantastischem Blick auf die Hafeneinfahrt und die Berge von Porto Andratx. Sie wurde in den letzten Jahren saniert und mit hochwertigen Materialien ausgestattet, wie z.B. gekalkte Eichenparkettböden, Fußbodenheizung (Öl/Wasser), Klimaanlage w/k, offener Kamin, moderne offene Einbauküche mit Kochinsel, Holz Doppelglasfenster, BUS Haussteuerung u.v.m. Die 387m² Wohnfläche verteilt sich auf 2 Wohnebenen. Im EG befinden sich die Eingangsdiele, Küche, Hauswirtschaftsraum, Esszimmer, Wohnzimmer, Büroraum, Gästezimmer mit Bad und Gäste WC. Im 1. OG hat es ein Master Schlafzimmer mit Bad en suite, Ankleide, Terrasse, sowie 3 Schlafzimmer und ein Badezimmer.\r\nDrei Garagen, überdachte und freie Terrassen, Grillplatz, ein Saunaraum mit Dusche und WC sowie ein Pool mit Liegeterrassen runden das Angebot ab.\r\n','33009','3900000','106','2015-06-16 15:35:15','110','2015-06-16 15:36:43',Null,'2411','166','1134',1,'1','0',Null,Null,Null,'33010',Null,'0','0','0',Null,'2015-06-16 15:56:13',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33011',Null,'33012',Null,'33013',Null,'33014','635 671 168','33015','0',0,'0');
